==Science, and technology, and mathematics== ===Mathematics and computing (general)=== * [[Accuracy and precision]], measurement deviation from true value and its scatter * [[Significant figures]], the number of digits that carry real information about a measurement * [[Precision and recall]], in information retrieval: the percentage of relevant documents returned * [[Precision (computer science)]], a measure of the detail in which a quantity is expressed * [[Precision (statistics)]], a model parameter or a quantification of precision
